import React, {useState, useEffect} from 'react';

export default function Todo(){

  const state = {
    todos: [
      { text: "Learn about React" },
      { text: "Add React Hooks" },
      { text: "Conditional styling" }
    ]
  }

  const setTodos = todos => this.setState({ todos });

  let listTodo = todos.map((item) => {
    return (
      <p>{item.text}</p>
    )
  })

  return (
    <div>
      HELLO
    </div>
  )
}
